webpackJsonp([0xdddc75538e93],{372:function(e,t){e.exports={data:{markdownRemark:{html:'<h1>Heading 1</h1>\n<h2>Heading 2</h2>\n<h3>Heading 3</h3>\n<h4>Heading 4</h4>\n<h5>Heading 5</h5>\n<h6>Heading 6</h6>\n<h1>Markdown Review</h1>\n<p>These examples were taken from <a href="https://guides.github.com/features/mastering-markdown/">github</a>.</p>\n<h2>Text</h2>\n<p>It\'s very easy to make some words <strong>bold</strong> and other words <em>italic</em> with Markdown. You can even <a href="http://google.com">link to Google!</a></p>\n<h2>Lists</h2>\n<p>Sometimes you want numbered lists:</p>\n<ol>\n<li>One</li>\n<li>Two</li>\n<li>Three</li>\n</ol>\n<p>Sometimes you want bullet points:</p>\n<ul>\n<li>Start a line with a star</li>\n<li>Profit!</li>\n</ul>\n<p>Alternatively,</p>\n<ul>\n<li>Dashes work just as well</li>\n<li>\n<p>And if you have sub points, put two spaces before the dash or star:</p>\n<ul>\n<li>Like this</li>\n<li>And this</li>\n</ul>\n</li>\n</ul>\n<h2>Images</h2>\n<p>If you want to embed images, this is how you do it:</p>\n<p><img src="https://octodex.github.com/images/yaktocat.png" alt="Image of Yaktocat"></p>\n<h2>Headers and quotes</h2>\n<h3>Structured documents</h3>\n<p>Sometimes it\'s useful to have different levels of headings to structure your documents. Start lines with a <code class="language-text">#</code> to create headings. Multiple <code class="language-text">##</code> in a row denote smaller heading sizes.</p>\n<h5>This is a fifth-tier heading</h5>\n<p>You can use one <code class="language-text">#</code> all the way up to <code class="language-text">######</code> six for different heading sizes.</p>\n<p>If you\'d like to quote someone, use the > character before the line:</p>\n<blockquote>\n<p>Coffee. The finest organic suspension ever devised... I beat the Borg with it.</p>\n<ul>\n<li>Captain Janeway</li>\n</ul>\n</blockquote>\n<h2>Code</h2>\n<p>There are many different ways to style code with GitHub\'s markdown. If you have inline code blocks, wrap them in backticks: <code class="language-text">var example = true</code>.  If you\'ve got a longer block of code, you can indent with four spaces:</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">if (isAwesome){\n  return true\n}</code></pre>\n      </div>\n<p>GitHub also supports something called code fencing, which allows for multiple lines without indentation:</p>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">if (isAwesome){\n  return true\n}</code></pre>\n      </div>\n<p>And if you\'d like to use syntax highlighting, include the language:</p>\n<div class="gatsby-highlight" data-language="language-js">\n      <pre class="language-language-js"><code class="language-language-js">if (isAwesome){\n  return true\n}</code></pre>\n      </div>\n<h2>Extras</h2>\n<ul>\n<li class="task-list-item"><input type="checkbox" checked disabled> This is a complete item</li>\n<li class="task-list-item"><input type="checkbox" disabled> This is an incomplete item</li>\n</ul>',frontmatter:{title:"Template Post"}}},pathContext:{slug:"/pages/blog/ze-template-post/post/"}}}});
